  false,\n\t\"url\": null,\n\t\"notes\": \"This project examines historical, archaeological,
  and geological evidence to re-evaluate the existing management paradigm that beaver
  are non-native to most of California. The purpose of the study is to identify where
  beaver historically existed or could have existed, with particular emphasis on their
  likely range within watersheds that are utilized by coho salmon or steelhead trout.
  Identification of the habitat overlap between beaver and these two salmonids will
  enable restoration efforts utilizing beaver to be targeted where they will maximize
  the benefits for these species in terms of rearing and overwintering habitat.nnLocation
  of historical locations of beaver in CA.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
